import React, {memo} from 'react';
import styled from 'styled-components';

import Title from '../../components/TitleContainer';

const DetailPagesContainer = styled.div`
    width:100%;
    height:auto;

    .contentWrap{
        width:1200px;
        margin:0 auto;
        color:#333333;

        .summaryWrap{
            .title{
                font-size:24px;
                font-weight: 500;
                width:100%;
                height: auto;
            }

            .tableWrap{
                width:100%;

                .tableItem{
                    border-bottom:1px solid #D9D9D9;
                    background-color: #ff05;
                    height: 300px;

                    &.rowOne{
                        display: flex;
                        height: 60px;

                        .colOne{
                            width:50%;
                            background-color: #f0f4;
                        }

                        .colTwo{
                            width:50%;
                            background-color: #0f03;
                        }
                    }

                    &.rowTwo{
                        height: 60px;
                    }

                    &.rowThr{
                        height: 300px;
                    }

                    &.rowFou{
                        height:60px;
                        display: flex;

                        .colOne{
                            width:50%;
                            background-color: #00f4;
                        }

                        .colTwo{
                            width:50%;
                            background-color: #f003;
                        }
                    }

                }

            }
        }
    }

`;

const DetailPages = memo(() => {
    return (
        <DetailPagesContainer>
        <Title title='취업지원' txt='취업 준비생 여러분의 취업을 돕기위한 정책들을 확인해보세요.' />
        <div className='contentWrap'>
            <div className='summaryWrap'>
                <h2 className='title'>정책요약</h2>  
                <div className='tableWrap'>
                    <div className='tableItem rowOne'>
                        <div className='colOne'></div>
                        <div className='colTwo'></div>
                    </div>
                    <div className='tableItem rowTwo'></div>
                    <div className='tableItem rowThr'></div>
                    <div className='tableItem rowFou'>
                        <div className='colOne'></div>
                        <div className='colTwo'></div>
                    </div>
                </div>
            </div>
        </div>
        </DetailPagesContainer>
    );
});

export default DetailPages;
